import React, { Component, useState } from 'react';
import ReactMapGl, { Marker, Popup } from 'react-map-gl';
import { coronaNepal } from './../src/httpBrowsing';
import './Mapbox.css';
import * as Data from './data.json';
import axios from 'axios';


function Mapbox() {

    const [viewPort, setviewPort] = useState({
        latitude: 27.713264,
        longitude: 85.322985,
        width: "100vw",
        height: "100vh",
        zoom: 10,
    })
    return (
        <ReactMapGl {...viewPort} mapboxApiAccessToken={process.env.REACT_APP_MAP_ACCESS_TOKEN} style="mapbox://styles/nabanit/cka7uauty1vpl1ip2f33744yz" onViewportChange={viewPort => setviewPort(viewPort)}>

        </ReactMapGl>
    )



}
